####***1.Import bibliotek***
"""

from keras.datasets import boston_housing #import danych
from keras import models, layers #sieci neuronowe
from keras.layers.attention.multi_head_attention import activation #funkcja aktywacji
import numpy as np #operacje na wektorach

"""####***2.Przygotowanie danych***"""

#Podział zbioru danych na zbiór uczący i testowy (według gotowego podziału z dokumentacji)

(train_data, train_labels), (test_data, test_labels) = boston_housing.load_data()

#standaryzacja danych (dane treningowe są podobne do testowych więc odejmowanie od wszystkich danych średniej ze zbioru treningowego niewiele zmienia)

mean=train_data.mean(axis=0)
train_data-=mean
std=train_data.std(axis=0)
train_data/=std
test_data-=mean
test_data/=std

"""####***3.Budowa i uczenie sieci***"""

#tworzymy funkcję, żeby każda kolejna warstwa dostosowywała się do elementów wyjściowych warstwy poprzedniej

def get_model():
  model=models.Sequential() #pusty model sekwencyjny - kolejne warstwy będziemy dodawać do modelu sekwencyjnie
  model.add(layers.Dense(32,input_dim=13,activation='relu')) #warstwa wejściowa
  model.add(layers.Dense((32), activation='relu')) #warstwa środkowa/ukryta
  model.add(layers.Dense(1)) #warstwa wyjścia
  model.compile(loss='mean_squared_error',optimizer='adam')
  return model

"""####***4.Walidacja krzyżowa***
W metodzie walidacji krzyżowej, zbiór danych dzielony jest na k równe podzbiory (nazywane foldami). Następnie model jest trenowany i testowany k razy, w każdym teście inny podzbiór jest używany jako zbiór testowy, a pozostałe podzbiory jako zbiór treningowy. Wyniki testów uśrednia się, aby uzyskać końcowy wynik.

Zaletą walidacji krzyżowej jest to, że każda próbka danych jest używana zarówno do trenowania, jak i do testowania, co zapewnia lepszą reprezentatywność danych i ogranicza wpływ losowości podziału danych na wyniki testów. Ponadto, poprzez wykorzystanie wielu podziałów, można uzyskać lepszą ocenę stabilności modelu.
"""

k=4 #liczba podzbiorów
len_data=len(train_data)//k #// dzielenie całkowite (zaokrągla wynik w dół do l.całkowitej)
num_epochs=25
all_mse=[] #tablica na wartości MSE, będziemy je uśredniać

for i in range(k):
  print("start i=",i) #do podglądu na jakim etapie uczenia jesteśmy
  val_data=train_data[i*len_data:(i+1)*len_data]
  val_labels=train_labels[i*len_data:(i+1)*len_data]
  part_train_data=np.concatenate([train_data[:i*len_data],train_data[(i+1)*len_data:]],axis=0)
  part_train_labels=np.concatenate([train_labels[:i*len_data],train_labels[(i+1)*len_data:]],axis=0)
  network=get_model()
  network.fit(part_train_data,part_train_labels,epochs=num_epochs,batch_size=1,verbose=0) #verbose=0 - nie wyświetla komunikatów
  mse=network.evaluate(val_data,val_labels,verbose=0)
  all_mse.append(mse)

"""####***5.Ocena jakości klasyfikacji***"""

#uśrednianie błędów MSE

all_mse
np.mean(all_mse)